import React from 'react';
import Navigationbar from './Navigationbar.js'
import Projects from './projects.js'
import Translateme from './translateme.js'
import Rickandmorty from './rickandmorty.js'
import Tonester from './tonester.js'
import { Embed, Modal, Popup } from 'semantic-ui-react'
import './App.css';


const styleMod = <link rel='stylesheet' href='https://cdn.jsdelivr.net/npm/semantic-ui@2.4.1/dist/semantic.min.css'/>

const stylePop = {
    borderRadius: 40,
    opacity: 1.7,
    padding: '1em',
  }
class App extends React.Component {
    constructor(){
      super()
      this.state = {
        pageState: "home",
        open: false
      }
    }

  show = (dimmer) => () => this.setState({dimmer, open: true })
  close = () => this.setState({ open: false })

  show2 = (dimmer) => () => this.setState({dimmer, open2: true })
  close2 = () => this.setState({ open2: false })

  show3 = (dimmer) => () => this.setState({dimmer, open3: true })
  close3 = () => this.setState({ open3: false })

  handleTranslateme=()=>{
    this.setState({
      pageState: "translateme"
    })
  }

  handleRickAndMorty=()=>{
    this.setState({
      pageState: "rickandmorty"
    })
  }

  handleTonester=()=>{
    this.setState({
      pageState: "tonester"
    })
  }

  handlePage=()=>{
    if(this.state.pageState === "translateme"){
      return <Translateme/> 
    }else if (this.state.pageState === "rickandmorty"){
      return <Rickandmorty/>
    }else if (this.state.pageState === "tonester"){
      return <Tonester/> 
    } else {
      return <Projects show={this.show} show2={this.show2} show3={this.show3} handleTranslateme={this.handleTranslateme} handleRickAndMorty={this.handleRickAndMorty} handleTonester={this.handleTonester}/>
    }
  }


  render(){
        const { open, dimmer } = this.state
        const { open2 } = this.state
        const { open3 } = this.state
  return (
    <div className="App">
     <Navigationbar handleSection1={this.handleSectionOne}/>
    {this.handlePage()}


    {styleMod}
                    <Modal basic dimmer={dimmer} open={open} onClose={this.close}>
                    <Modal.Header><h2 >Translate Me</h2></Modal.Header>
                    <Modal.Content >
                        <Modal.Description>
                         <h2 class="translatemeContentModal">Translate me uses a machine learning technology to classify and translate images into different languages. Once the image is captured, users can flip the image to reveal the desired translated word for the image.</h2>
                        </Modal.Description>

                        <Embed
                            id='O6Xo21L0ybE'
                            placeholder='/images/image-16by9.png'
                            source='youtube'
                        />
                        <h2 class="translatemeTitle">Technologies</h2>

                        <div class="ui tablet equal width grid">
                            <div class="column">
                             <Popup flowing position='bottom center' style={stylePop} inverted size='large' content='Ruby on Rails' trigger={<img class="techLogoTranslatMe" src="/ruby.png"/> } />
                            </div>
                            <div class="column">
                            <Popup flowing position='bottom center' style={stylePop} inverted size='large' content='React' trigger={<img class="techLogoTranslatMe" src="/react.png"/>  } />
                            </div>
                            <div class="column">
                            <Popup flowing position='bottom center' style={stylePop} inverted size='large' content='IBM Watson' trigger={<img class="techLogoTranslatMe" src="/watson.png"/>  } />
                            </div>
                            <div class="column">
                            <Popup flowing position='bottom center' style={stylePop} inverted size='large' content='Cloudinary' trigger={<img class="techLogo" src="/cloudLogo.png"/> } />
                             </div>
                             <div class="column">
                            <Popup flowing position='bottom center' style={stylePop} inverted size='large' content='Semantic ui' trigger={<img class="techLogo" src="/semantic.png"/> } />
                             </div>

                        </div>

                    </Modal.Content>

                    </Modal>


    </div>
  );
  }
}

export default App;
